textOriginal:
A verdade vencerá a mentira;
O afeto vencerá o ódio;
O amor vencerá a intolerância;

E essa exploração covarde do cristianismo por parte do sr presidente será fator determinante para o resultado final.
Deus não cochila, não dorme, e não pode ser ludibriado por um declarado simpatizante da tortura, da violência, um auto intitulado especialista em matar e toda essa sua corja de falsos cristãos que não entendem uma vírgula dos ensinamentos de Jesus Cristo.

Perderão aqui, nessa terra, e perderão ainda mais no dia do julgamento, pois quem deturpa o sagrado nome de Jesus em favor de um bandido como Bolsonaro não ficará impune diante do Pai.

Bolsonaro passou 4 anos desrespeitando o povo brasileiro. Usando nosso dinheiro pra comprar simpatia de políticos safados, ao invés de investir em políticas públicas...

Ficar falando que tudo é culpa do PT e do STF, como ele faz, só cola com extremistas fanáticos, não com o povo em geral.

Não é culpa do PT essa inflação criminosa;
Não é culpa do PT quase 700 mil mortos na pandemia por negligência do governo;
Não é culpa do PT o Orçamento Secreto;
Não é culpa do PT a onda de intolerância e violência que esse governo atual alimenta diariamente;

O Brasil não aguenta mais Bolsonaro!!!
